PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE titles (
            tconst TEXT PRIMARY KEY,
            title TEXT,
            year INTEGER,
            runtime INTEGER,
            genres TEXT
        );
CREATE TABLE ratings (
            tconst TEXT PRIMARY KEY,
            averageRating REAL,
            numVotes INTEGER
        );
CREATE TABLE crew (
            tconst TEXT PRIMARY KEY,
            directors TEXT,
            writers TEXT
        );
CREATE TABLE principals (
            tconst TEXT,
            ordering INTEGER,
            nconst TEXT,
            category TEXT,
            character TEXT
        );
CREATE TABLE names (
            nconst TEXT PRIMARY KEY,
            name TEXT,
            birth INTEGER,
            death INTEGER,
            profession TEXT,
            knownForTitles TEXT
        );
COMMIT;